export const myFragment = `fragment fragmentFields on Todo {
id
title
completed
}`;

import { gql } from "@apollo/client";
import { useQuery } from "@apollo/client/react";
const App = () => {
const QUERY = gql`
query GetTodo ($id: ID!) {
getTodo (id: $id) {
...fragmentFields
}
}
`;
const { data } = useQuery(QUERY);
return (<> {data?.Todo?.title} </>)
}
export default App;

@apollo/client/cacheからcreateFragmentRegistryをimportし
InCacheMemoryのコンストラクター引数 fragments
にフラグメント定義を元に作成したcreateFragmentRegistryインスタンスを渡す
